import React, {useEffect,useState} from 'react';
//import axios from 'axios';
import Box from '@mui/material/Box';
import Grid from '@mui/material/Grid';
import Paper from '@mui/material/Paper';
import { makeStyles, styled } from '@material-ui/core';
import { Table, TableContainer, TableHead, TableCell, TableBody, TableRow, Modal, Button, TextField } from '@material-ui/core';
import {Edit, Delete} from '@material-ui/icons';
import { Contenedor } from '../../Components';

const useStyles = makeStyles((theme)=>({
    modal:{
        position: 'absolute',
        width: 400,
        backgroundColor: theme.palette.background.paper,
        border: '2px solid #000',
        boxShadow: theme.shadows[5],
        padding: theme.spacing(2,4,3),
        top: '50%',
        left:'50%',
        transform: 'translate(-50%, -50%)'
    },
    icons: {
        cursor: 'pointer'
    },
    inputMaterial:{
        width: '100%'
    },
    text:{
        fontFamily: 'oswald',
    },
    text2:{
        textAlign : 'left',
        marginLeft: '20px'
    }

  
}));


  

export default function PrincipalClub() {
    const classes = useStyles()

    return (
        <div>
            <Contenedor/>
            <div align = 'center'>
                <Box 
                    sx = {{flexGrow: 20}}
                    color = 'contrastText'
                    backgroundColor = '#D8F3DC'
                    mx = {20} //margen a todos los lados
                    p = {1} //padding
                    borderRadius = '8px'
                    border = {2}
                    
                    
                >
                    <h1 >Padel del mar</h1>
                </Box>
                <br></br>
                <Box
                    sx = {{flexGrow: 20}}
                    color = 'contrastText'
                    backgroundColor = '#D8F3DC'
                    mx = {20} //margen a todos los lados
                    //p = {30} //padding
                    borderRadius = '8px'
                    border = {2}
                    
                >
                    <Grid container>

                        <h2 className={classes.text2}>Direccion:</h2>
                        <Grid item xs = {2} marginTop= {'10px'} marginLeft = {'10px'}>
                            <TextField variant='outlined' size = 'medium'/>
                        </Grid>
                        <Grid item xs = {12}>
                            <h2 className={classes.text2}>Representante:</h2>
                        </Grid>
                        <Grid item xs = {12}>
                            <h2 className={classes.text2}>Telefono:</h2>
                        </Grid>
                        <Grid item xs = {12}>
                            <h2 className={classes.text2}>Comuna:</h2>
                        </Grid>
                    </Grid>

                    
                </Box>
            </div>
        </div>
        
    )
}
